Penilaian nilai wajar tanah yang dimiliki Grup pada 2023 telah dilakukan oleh KJPP Febriman Siregar \& Rekan dengan penilai independen yaitu Febriman Muda Siregar, ST., MM., MAPPI, KJPP Nirboyo Adiputro, Dewi Apriyanti \& Rekan dengan penilai independen yaitu Muhammad Haikal, S.E., M.Ec.Dev., MAPPI, dan KJPP Dedy, Arifin, Nazir dan Rekan dengan penilai independen Ir. H. Zainal Arifin, M. Ec. Dev., MAPPI yang telah teregistrasi pada OJK. Hierarki nilai wajar Tingkat 2 dari tanah dihitung dengan menggunakan pendekatan data pasar. Elemen-elemen yang digunakan dalam perbandingan data untuk menentukan nilai wajar aset, antara lain:

1. Lokasi;
2. Jenis surat tanah;
3. Kondisi pembiayaan;
4. Kondisi transaksi;
5. Kondisi pasar;
6. Karakteristik fisik;
7. Karakteristik ekonomi;
8. Penggunaan.

Aset tetap Grup berupa bangunan gedung, perlengkapan proyek, perlengkapan kantor serta kendaraan bermotor telah diasuransikan dengan nilai pertanggungan sebesar Rp 6.593.159. Manajemen berpendapat bahwa nilai pertanggungan tersebut cukup untuk menutupi kemungkinan kerugian atas aset yang dipertanggungkan.

Beberapa aset tetap digunakan sebagai jaminan atas pinjaman bank (Catatan 21).

Pada tanggal 31 Desember 2024, Manajemen berpendapat bahwa tidak ada indikasi penurunan nilai aset tetap.

